jQuery.noConflict(),jQuery(document).ready(function(t){t("#yith_ctwp_pdf_button").on("click",function(){t(this).css("pointer-events","none"),t(this).after('<img class="yith_ctpw_loading" src="'+yith_ctpw_ajax.loading_gif+'" />'),t.ajax({type:"POST",url:yith_ctpw_ajax.ajaxurl,data:{action:"yith_ctpw_get_pdf",order_id:yith_ctpw_ajax.order_id},dataType:"json",success:function(e,c,i){e.status&&""!=e.file&&(t('<iframe id="pdf_creator_ctpw" src="'+yith_ctpw_ajax.pdf_creator+"?pdf="+e.file+"&secure_check=yctpw_sec_check&file_name="+yith_ctpw_ajax.file_name+'"></iframe>').appendTo("body").hide(),setTimeout(function(){t("#pdf_creator_ctpw").remove(),t(".yith_ctpw_loading").remove(),t("#yith_ctwp_pdf_button").css("pointer-events","all")},500))},error:function(t){console.log("yith_ctpw_pdf_creation_error")}})})});